INSERT INTO `gbjh9_acymailing_mail` (`mailid`, `subject`, `body`, `altbody`, `published`, `senddate`, `created`, `fromname`, `fromemail`, `replyname`, `replyemail`, `type`, `visible`, `userid`, `alias`, `attach`, `html`, `tempid`, `key`, `frequency`, `params`, `sentby`, `metakey`, `metadesc`, `filter`) VALUES
(1, 'New Subscriber on your website', '<p>Hello {subtag:name},</p><p>A new user has been created in AcyMailing : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'notification_created', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'A User unsubscribed from all your lists', '<p>Hello {subtag:name},</p><p>The user {user:name} : {user:email} unsubscribed from all your lists</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'notification_unsuball', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'A User unsubscribed', '<p>Hello {subtag:name},</p><p>The user {user:name} : {user:email} unsubscribed from your list</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'notification_unsub', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 'A User refuses to receive e-mails from your website', '<p>The User {user:name} : {user:email} refuses to receive any e-mail anymore from your website.</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'notification_refuse', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, '{subtag:name}, please confirm your subscription', '<p> Hello {subtag:name}, </p><p><strong>{confirm}Click here to confirm your subscription{/confirm}</strong></p>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'confirmation', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'AcyMailing Cron Report {mainreport}', '<p>{report}</p><p>{detailreport}</p>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'report', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'A Newsletter has been generated : \"{subject}\"', '<p>The Newsletter issue {issuenb} has been generated : </p><p>Subject : {subject}</p><p>{body}</p>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'notification_autonews', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Modify your subscription', '<p>Hello {subtag:name}, </p><p>You requested some changes on your subscription,</p><p>Please {modify}click here{/modify} to be identified as the owner of this account and then modify your subscription.</p>', '', 1, NULL, NULL, '', '', '', '', 'notification', 0, NULL, 'modif', NULL, 1, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `gbjh9_acymailing_template` (`tempid`, `name`, `description`, `body`, `altbody`, `created`, `published`, `premium`, `ordering`, `namekey`, `styles`, `subject`, `stylesheet`, `fromname`, `fromemail`, `replyname`, `replyemail`, `thumb`, `readmore`) VALUES
(1, 'White Shadow Red', '', '<div style=\"background-color: #e2e8df; width: 100%; color: #8a8a8a; text-align: center;\">\r\n	<table style=\"text-align: left; margin: auto;\" align=\"center\" width=\"560\" cellspacing=\"0\" cellpadding=\"0\">\r\n		<tr>\r\n			<td class=\"hideonline\" style=\"padding: 20px 0px; font-size: 10px; color: #000000; margin: auto; text-align: center;\" colspan=\"3\">This email contains graphics, so if you don\'t see them, {readonline}view it in your browser{/readonline}.</td>\r\n		</tr>\r\n		<tr>\r\n			<td width=\"37\"> </td>\r\n			<td style=\"background-color: #fbfbf7;\" valign=\"top\" width=\"496\">\r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n					<tr>\r\n						<td colspan=\"2\" height=\"20\"> </td>\r\n					</tr>\r\n					<tr>\r\n						<td width=\"20\"> </td>\r\n						<td style=\"background-color: #f9f7d3;\" width=\"456\" height=\"110\">\r\n							<table width=\"456\" cellspacing=\"0\" cellpadding=\"0\">\r\n								<tr>\r\n									<td colspan=\"3\" height=\"11\"> </td>\r\n								</tr>\r\n								<tr>\r\n									<td width=\"7\"> </td>\r\n									<td style=\"line-height: 0px;\"><img src=\"http://www.acyba.com/images/templates/newsletter-1/logo-icon.png\" border=\"0\" alt=\"\" /></td>\r\n									<td valign=\"top\">\r\n										<h1>AcyMailing is Out!</h1>\r\n									</td>\r\n								</tr>\r\n								<tr>\r\n									<td colspan=\"3\" height=\"3\"> </td>\r\n								</tr>\r\n							</table>\r\n						</td>\r\n						<td width=\"20\"> </td>\r\n					</tr>\r\n					<tr>\r\n						<td colspan=\"5\">\r\n							<table width=\"100%\">\r\n								<tr>\r\n									<td width=\"40\"> </td>\r\n									<td>\r\n										<div class=\"acymailing_content\">\r\n											<h2>E-Mail</h2>\r\n											<p style=\"text-align: justify;\"><img src=\"http://www.acyba.com/images/templates/newsletter-1/acymailing.png\" border=\"0\" alt=\"\" style=\"margin: 10px; float: right;\" /> Electronic mail, often abbreviated as email or e-mail, is a method of exchanging digital messages, designed primarily for human use. E-mail systems are based on a store-and-forward model in which e-mail computer server systems accept, forward, deliver and store messages on behalf of users, who only need to connect to the e-mail infrastructure, typically an e-mail server, with a network-enabled device (e.g., a personal computer) for the duration of message submission or retrieval.<br /><a href=\"http://en.wikipedia.org/wiki/E-mail\">Wikipedia</a></p>\r\n										</div>\r\n										<div class=\"acymailing_content\">\r\n											<h2>Marketing Campaign</h2>\r\n											<p><img src=\"http://www.acyba.com/images/templates/newsletter-1/essential.png\" border=\"0\" alt=\"\" style=\"float: left; margin: 10px;\" />Marketing is an integrated communications-based process through which individuals and communities are informed or persuaded that existing and newly-identified needs and wants may be satisfied by the products and services of others.</p>\r\n											<p>Marketing is used to create the customer, to keep the customer and to satisfy the customer. <a href=\"http://en.wikipedia.org/wiki/Marketing_campaign\">Wikipedia</a></p>\r\n										</div>\r\n										<div class=\"acymailing_content\">\r\n											<h2>Joomla!</h2>\r\n											<p>Joomla! is a content management system platform for publishing content on the World Wide Web and intranets as well as a Model–view–controller (MVC) Web Application Development framework.</p>\r\n											<p>The system includes features such as page caching to improve performance, RSS feeds, printable versions of pages, news flashes, blogs, polls, website searching, and language internationalization.<br /><a href=\"http://en.wikipedia.org/wiki/Joomla\">Wikipedia</a></p>\r\n										</div>\r\n									</td>\r\n									<td width=\"40\"> </td>\r\n								</tr>\r\n							</table>\r\n						</td>\r\n					</tr>\r\n				</table>\r\n			</td>\r\n			<td width=\"27\"> </td>\r\n		</tr>\r\n		<tr style=\"line-height: 0px;\">\r\n			<td style=\"line-height: 0px;\" colspan=\"3\"><img src=\"media/com_acymailing/templates/newsletter-1/page-footer.png\" border=\"0\" alt=\"\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding: 20px 0px; font-size: 10px; color: #000000; margin: auto; text-align: center;\" colspan=\"3\">Not interested any more? {unsubscribe}Unsubscribe{/unsubscribe}</td>\r\n		</tr>\r\n	</table>\r\n</div>', '', NULL, 1, 0, 1, 'newsletter-1', 'a:9:{s:18:\"acymailing_content\";s:129:\"clear:both;text-align:justify;font-family: Verdana, Arial, Helvetica, sans-serif;font-size:12px;line-height:14px;margin-top:10px;\";s:16:\"acymailing_title\";s:89:\"color:#8a8a8a;font-weight:normal;font-size:14px;margin:0;border-bottom:5px solid #d39f9f;\";s:16:\"acymailing_unsub\";s:31:\"font-weight:bold;color:#000000;\";s:19:\"acymailing_readmore\";s:14:\"color:#d39f9f;\";s:17:\"acymailing_online\";s:31:\"font-weight:bold;color:#000000;\";s:6:\"tag_h1\";s:128:\"margin-bottom:0;margin-top:0;font-family: Verdana, Arial, Helvetica, sans-serif;font-size:26px;color:#d47e7e;vertical-align:top;\";s:6:\"tag_h2\";s:100:\"color:#8a8a8a !important;font-weight:normal;font-size:14px;margin:0;border-bottom:5px solid #d39f9f;\";s:6:\"tag_h3\";s:68:\"color:#8a8a8a !important;font-weight:normal;font-size:100%;margin:0;\";s:8:\"color_bg\";s:7:\"#e2e8df\";}', NULL, 'div,table{font-family: Verdana, Arial, Helvetica, sans-serif; font-size:12px;}', NULL, NULL, NULL, NULL, 'media/com_acymailing/templates/newsletter-1/newsletter-1.png', NULL),
(2, 'Clean White Pink', '', '<div style=\"background-color: #ffffff; width: 100%; color: #8a8a8a; text-align: center;\">\r\n<table style=\"text-align: left; margin: auto;\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td class=\"hideonline\" style=\"padding: 20px 0px; font-size: 10px; color: #000000; margin: auto; text-align: center;\" colspan=\"3\">This email contains graphics, so if you don\'t see them, {readonline}view it in your browser{/readonline}.</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"370\">\r\n<h1>AcyMailing is Out!</h1>\r\n<br />\r\n<div class=\"acymailing_content\">\r\n<h2>E-Mail</h2>\r\n<p style=\"font-size: 10px; margin-top: 0px;\"><img src=\"http://www.acyba.com/images/templates/newsletter-1/acymailing.png\" border=\"0\" alt=\"\" style=\"float: left;\" />Electronic mail, often abbreviated as email or e-mail, is a method of exchanging digital messages, designed primarily for human use.<br /><a href=\"http://en.wikipedia.org/wiki/E-mail\">Wikipedia</a></p>\r\n<a href=\"#\" style=\"font-size: 10px; color: #999999;\">Read More</a></div>\r\n<div class=\"acymailing_content\">\r\n<h2>Marketing Campaign</h2>\r\n<p style=\"font-size: 10px; margin-top: 0px;\"><img src=\"http://www.acyba.com/images/templates/newsletter-1/essential.png\" border=\"0\" alt=\"\" style=\"float: left;\" />Marketing is an integrated communications-based process through which individuals and communities are informed or persuaded that existing and newly-identified needs and wants may be satisfied by the products and services of others.</p>\r\n<p style=\"font-size: 10px; margin-top: 0px;\">Marketing is used to create the customer, to keep the customer and to satisfy the customer. <a href=\"http://en.wikipedia.org/wiki/Marketing_campaign\">Wikipedia</a></p>\r\n<a href=\"#\" style=\"font-size: 10px; color: #999999;\">Read More</a></div>\r\n</td>\r\n<td width=\"20\"> </td>\r\n<td valign=\"top\" width=\"210\"><img src=\"http://www.acyba.com/images/templates/newsletter-2/logo-icon.jpg\" border=\"0\" alt=\"\" width=\"207\" height=\"137\" />\r\n<div class=\"acymailing_content\">\r\n<h2>Joomla!</h2>\r\n<p style=\"font-size: 10px; margin-top: 0px;\">Joomla! is a content management system platform for publishing content on the World Wide Web and intranets as well as a Model–view–controller (MVC) Web Application Development framework.</p>\r\n<img src=\"media/com_acymailing/templates/newsletter-2/hori-separator.png\" border=\"0\" alt=\"\" />\r\n<p style=\"font-size: 10px; margin-top: 0px;\">The system includes features such as page caching to improve performance, RSS feeds, printable versions of pages, news flashes, blogs, polls, website searching, and language internationalization.<br /><a href=\"http://en.wikipedia.org/wiki/Joomla\">Wikipedia</a></p>\r\n<a href=\"#\" style=\"font-size: 10px; color: #999999;\">Read More</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center; padding: 20px 0px; font-size: 10px; color: #000000;\" colspan=\"3\">Not interested any more? {unsubscribe}Unsubscribe{/unsubscribe}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', '', NULL, 1, 0, 2, 'newsletter-2', 'a:8:{s:18:\"acymailing_content\";s:63:\"clear:both;text-align:justify;line-height:14px;margin-top:10px;\";s:16:\"acymailing_title\";s:94:\"color:#8a8a8a;text-align:right;border-bottom:6px solid #d39fc9;font-size:16px;margin-top:10px;\";s:19:\"acymailing_readmore\";s:32:\"font-size: 10px; color: #999999;\";s:6:\"tag_h1\";s:144:\"margin-bottom:0;margin-top:0;font-family:Verdana, Arial, Helvetica, sans-serif;font-size:26px;color:#d47e7e;vertical-align:top;text-align:center\";s:8:\"color_bg\";s:7:\"#ffffff\";s:6:\"tag_h2\";s:105:\"color:#8a8a8a !important;text-align:right;border-bottom:6px solid #d39fc9;font-size:16px;margin-top:10px;\";s:6:\"tag_h3\";s:85:\"color:#8a8a8a !important;text-align:right;font-weight:normal;font-size:100%;margin:0;\";s:5:\"tag_a\";s:39:\"color:#d39fc9;text-decoration:underline\";}', NULL, 'div,table{font-family: Verdana, Arial, Helvetica, sans-serif; font-size:12px;}', NULL, NULL, NULL, NULL, 'media/com_acymailing/templates/newsletter-2/newsletter-2.png', NULL),
(3, 'Rounders and corners', '', '<div style=\"background-color: #dfe6e8; width: 100%; font-family: Verdana, Arial, Helvetica, sans-serif; color: #8a8a8a; text-align: center;\">\r\n<table style=\"text-align: left; margin: auto;\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td class=\"hideonline\" style=\"font-size: 10px; color: #000000; margin: auto; text-align: center; padding: 20px 0px;\" colspan=\"3\">This email contains graphics, so if you don\'t see them, {readonline}view it in your browser{/readonline}.</td>\r\n</tr>\r\n<tr>\r\n<td valign=\"top\" width=\"216\">\r\n<table cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"line-height: 0px;\">\r\n<td style=\"text-align: center;\"><img src=\"http://www.acyba.com/images/templates/newsletter-3/logo-icon.jpg\" border=\"0\" alt=\"\" width=\"207\" height=\"137\" /></td>\r\n</tr>\r\n<tr>\r\n<td height=\"20\"> </td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<table cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"line-height: 0;\">\r\n<td style=\"line-height: 0px;\" colspan=\"3\" width=\"216\" height=\"15\"><img src=\"media/com_acymailing/templates/newsletter-3/top23rds.png\" border=\"0\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #ffffff;\" width=\"15\"> </td>\r\n<td style=\"background-color: #ffffff;\" width=\"186\">\r\n<div class=\"acymailing_content\">\r\n<h2>Joomla!</h2>\r\n<p style=\"font-size: 10px; margin-top: 0px;\">Joomla! is a content management system platform for publishing content on the World Wide Web and intranets as well as a Model–view–controller (MVC) Web Application Development framework.</p>\r\n<img src=\"media/com_acymailing/templates/newsletter-2/hori-separator.png\" border=\"0\" alt=\"\" />\r\n<p style=\"font-size: 10px;\">The system includes features such as page caching to improve performance, RSS feeds, printable versions of pages, news flashes, blogs, polls, website searching, and language internationalization.<b