etter-3/bottom23rd.png\" border=\"0\" alt=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height=\"20\"> </td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<table cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"line-height: 0;\">\r\n<td style=\"line-height: 0px;\" colspan=\"3\" width=\"323\" height=\"15\"><img src=\"media/com_acymailing/templates/newsletter-3/top23rd.png\" border=\"0\" alt=\"\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #ffffff;\" width=\"15\"> </td>\r\n<td style=\"background-color: #ffffff;\" width=\"293\">\r\n<div class=\"acymailing_content\">\r\n<h2>Marketing Campaign</h2>\r\n<p style=\"font-size: 10px; margin-top: 0px;\"><img src=\"http://www.acyba.com/images/templates/newsletter-1/essential.png\" border=\"0\" alt=\"\" style=\"float: right;\" />Marketing is an integrated communications-based process through which individuals and communities are informed or persuaded that existing and newly-identified needs and wants may be satisfied by the products and services of others.</p>\r\n<img src=\"media/com_acymailing/templates/newsletter-2/hori-separator.png\" border=\"0\" alt=\"\" />\r\n<p style=\"font-size: 10px;\">Marketing is used to create the customer, to keep the customer and to satisfy the customer. <a href=\"http://en.wikipedia.org/wiki/Marketing_campaign\">Wikipedia</a></p>\r\n<a href=\"#\" style=\"font-size: 10px; color: #999999;\">Read More</a></div>\r\n</td>\r\n<td style=\"background-color: #ffffff;\" width=\"15\"> </td>\r\n</tr>\r\n<tr style=\"line-height: 0;\">\r\n<td style=\"line-height: 0px;\" colspan=\"3\" width=\"323\" height=\"15\"><img src=\"media/com_acymailing/templates/newsletter-3/bottom23rd.png\" border=\"0\" alt=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"padding: 20px 0px; font-size: 10px; color: #000000; margin: auto; text-align: center;\" colspan=\"3\">Not interested any more? {unsubscribe}Unsubs