(50, 96, 'Template Features', 'template-features', '<div align=\"center\">\r\n<div style=\"max-width: 1180px;margin-top:-20px;\"><img class=\"imgframe\" src=\"images/features.jpg\" border=\"0\" style=\"max-width: 98%;\" /> <br /><br />\r\n<h2 class=\"titlefont\" style=\"text-align: center; padding: 24px 0 48px; margin-bottom: 24px; border-bottom: 1px solid #d6d6d6; font-size: 42px;\"><span class=\"basecolor_1\">MOZAIX</span><br /><span class=\"basecolor_2\">A Premium Joomla Template</span></h2>\r\n\r\n<br /><br />\r\n<div class=\"row-fluid\">\r\n<div class=\"span4\">Mozaix is a sleek cutting edge design perfect for Online Magazines, Entertainment News, Blogs, Photography Sites, Online Portfolio\'s, Video Sites, E-Commerce Shops or anything you could ever want it to be! Designed with the latest in flat and colorful design styles, Mozaix also takes advantage of the latest in CSS3 animations and effects. </div>\r\n<div class=\"span4\">The core Joomla template features (70+) module positions; (60+) module style variations, (6) preset styles, rich typography options, CSS3 progressive enhancements, Bootstrapped and Responsive Design. The Quickstart even comes with JoomlaXTC\'s most popular extensions (Over $100 worth!) — Deluxe NewsPro, Our K2 Walls and more.</div>\r\n<div class=\"span4\">Mozaix was built with the JoomlaXTC Framework which offers deep customization options and gives you total control over your site\'s look &amp; feel—from Width Adjustments, Region Layout, Backgrounds, Font Colors / Sizes / Typeset, Module Layout and custom preset styles.</div>\r\n</div>\r\n<br /><br /><br /><br />\r\n<div align=\"center\"><img class=\"imgframe\" src=\"images/bootstrap.jpg\" border=\"0\" style=\"margin-bottom: 30px;\" /></div>\r\n<br />\r\n<h2 style=\"text-align: center; padding: 24px 0 48px; margin-bottom: 24px; border-bottom: 1px solid #d6d6d6; font-size: 42px;\"><span class=\"basecolor_1\">XTC Framework 2.0: </span><span class=\"basecolor_2\">Built on Bootstrap</span></h2>\r\n<div class=\"row-fluid\">\r\n<div class=\"span4\">\r\n<p style=\"font-size: 16px; color: #333; font-weight: normal; margin-top: 0;\">Bootstrap is a Sleek, intuitive, and powerful front-end framework for faster and easier web development. We use a new responsive, fluid grid system to create seamless, responsive layouts. By using the core Bootstrap and custom break points, our responsive design is as dynamic as possible using only CSS3 media queries.</p>\r\n</div>\r\n<div class=\"span4\">\r\n<p style=\"font-size: 14px; margin-top: 0;\">Bootstrap also provides styles for common HTML elements like typography, code, tables, forms, and buttons. It also includes <a href=\"http://glyphicons.com\" target=\"_blank\">Glyphicons</a>, a great little icon set, as well as the Font Awesome icon set for even more font based icons.</p>\r\n<p style=\"font-size: 14px;\">The XTC Bootstrap grid utilizes 12 columns, allowing you to create a fluid AND responsive layout. With the responsive grid in, the layout will adapt to any screensize. The columns become fluid and stack vertically, and each column will adapt to the available size it should have ensuring proper proportions all devices.</p>\r\n</div>\r\n<div class=\"span4\">\r\n<p style=\"margin-top: 0;\">Media queries allow for custom CSS based on a number of conditions—ratios, widths, display type, etc—but usually focuses around <code>min-width</code> and <code>max-width</code>.</p>\r\n<ul>\r\n<li>Modify the width of column in our grid</li>\r\n<li>Stack elements instead of float wherever necessary</li>\r\n<li>Resize headings and text to be more appropriate for devices</li>\r\n</ul>\r\n<p style=\"font-weight: bold; color: #333;\">Use media queries responsibly and only as a start to your mobile audiences. For larger projects, do consider dedicated code bases and not layers of media queries.</p>\r\n</div>\r\n</div>\r\n<h2 style=\"text-align: center; padding: 24px 0 48px; margin-bottom: 24px; border-bottom: 1px solid #d6d6d6; font-size: 42px;\"><span class=\"basecolor_1\">Template Features</span></h2>\r\n<div class=\"row-fluid\">\r\n<div class=\"span4\">\r\n<p style=\"font-size: 20px; color: #333;\">Specifications:</p>\r\n<ul class=\"list1\">\r\n<li>6 Preset Styles</li>\r\n<li>70+ Module Positions</li>\r\n<li>60+ Stock Module Suffix Styles</li>\r\n<li>3 Mootools based Menu Styles - Suckerfish - Dropline - DualFish</li>\r\n<li>Commented source files</li>\r\n<li>Cross Browser Support for IE9, Firefox, Opera, Safari and Chrome.</li>\r\n</ul>\r\n</div>\r\n<div class=\"span4\">\r\n<p style=\"font-size: 20px; margin-bottom: 20px; color: #333;\">Advanced Features:</p>\r\n<ul class=\"list1\">\r\n<li>XTC Template Framework</li>\r\n<li>Tableless CSS3 Template Design</li>\r\n<li>Responsive CSS3 Grid</li>\r\n<li>Bootstrapped Template</li>\r\n<li>Article Sidebars</li>\r\n<li>Mulitple Layout Options</li>\r\n<li>Custom Joomla Content Overides</li>\r\n</ul>\r\n</div>\r\n<div class=\"span4\">\r\n<p style=\"font-size: 20px; margin-bottom: 20px; color: #333;\">Package Includes:</p>\r\n<ul class=\"list1\">\r\n<li>JoomlaXTC Quickstart Installer</li>\r\n<li>JoomlaXTC Club Template</li>\r\n<li>JoomlaXTC Extensions</li>\r\n<li>K2</li>\r\n<li>K2 Store Free Edition</li>\r\n<li>Komento Free Edition</li>\r\n<li>ACYMailing Starter Edition</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 2, '2019-07-26 06:13:26', 60, '', '2019-07-26 06:13:26', 60, 0, '0000-00-00 00:00:00', '2019-07-26 06:13:26', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"1\",\"link_titles\":\"0\",\"show_intro\":\"0\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"0\",\"link_parent_category\":\"\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"0\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 177, 14, '', '', 1, 604, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 1, '*', '');
