(51, 97, 'Included Extensions', 'included-extensions', '<p style=\"font-size:22px; color:#333;line-height:110%; margin:0;\">Mozaix comes complete with some of our most popular extensions (Over $100 worth!) - pre packaged with the quickstart and full template versions.  Giving you more than just a template - Mozaix is a full website ready for launching in minutes!</p>\r\n\r\n<br /><br />\r\n<h2>JXTC Reading List Component</h2>\r\n<p>Reading List enhances content-rich sites by enabling users to select Joomla articles and/or K2 Items for inclusion in their own personal Reading List. They can later browse and read the articles in an easy to use interface. Even more, they can share their content selection with social networks and provide a personalized reading link to friends and public alike</p>\r\n<br /><br />\r\n<h2>JXTC Deluxe NewsPro Module</h2>\r\n<p>Become an instant high definition news portal thanks to the Joomla XTC Deluxe News Pro Module. This powerful module makes your site the ultimate news network with ease by displaying your Joomla content with custom CSS and HTML in a module position. Choose your articles with category, section, and more control than ever. Customize your vision of the news by using the module’s ability to display Joomla Plugins in articles, display columns, grids, as well as scrolling content for sliders and slideshows.<br />This module requires CSS and HTML knowledge for custom layout designs.</p>\r\n<br /><br />\r\n\r\n<h2>JXTC Custom HTML Pro Module</h2>\r\n<p>This versatile module allows you to enter Text, HTML, JavaScript or CSS code for display on any module position or even the area of your site. You can edit complex HTML designs or enter plain-text code for custom displays, additional CSS stylings, embeded flash elements or external javaScript programs. What\'s more, the module supports any Joomla! content plugin allowing you to customize your content even more. </p>\r\n<br /><br />\r\n\r\n<h2>JXTC K2 Content Wall</h2>\r\n<p>The King of K2 Content modules the JoomlaXTC K2 Content Wall makes your site the ultimate K2 network with ease by displaying your K2 content with custom CSS and HTML in a module position. Choose your articles with category, section, and more control than ever. Customize your vision of content by using the module’s ability to display your custom mark up, use one of our 38 demo template designs, or edit one of our designs to your heart\'s content. Display Joomla Plugins in articles, display columns, grids, as well as based content for sliders and slideshows - The possibilities are Endless!</p>\r\n<br /><br />\r\n<h2>SlidePanel Module</h2>\r\n<p>Enhance the browsing experience on your website with XTC Panel Slide by placing a clickable area containing plain text, an image or HTML code that in turn will show a sliding panel coming from the top or bottom of your website. </p>\r\n<br /><br />\r\n<h2>Komento Wall Module</h2>\r\n<p>\r\nDisplay comment lists anywhere on your site with total layout and style control. Use pre-made templates or create your own custom HTML and CSS templates to show messages in rows, columns and grids with one or more pages as well as special animation effects for page transitions.</p>\r\n<br /><br />\r\n<h2>Socializer Wall Module</h2>\r\n<p>Manage dozens of social network links with total layout and style control with pre-made templates or use your own custom HTML and CSS.  </p>\r\n<br /><br />\r\n\r\n\r\n<h2>3RD Party Components</h2><br /><br />\r\n\r\n<h2>K2 <a href=\"http://www.getk2.org\">(www.getk2.org)</a></h2>\r\n<p>You\'ve already been there... Joomla! is a great content management system. In fact it\'s considered one of the best in the world. But the default article system in Joomla! is so spartan! Just a title, your content body and that\'s it. This is where K2 comes in.\r\n<br />\r\nK2 was built as a complete replacement of the default article system in Joomla!. Install it like any Joomla! extension, import your articles from the default Joomla! article system and you instantly get a host of new features for your existing content: rich content forms for items (think of Joomla! articles with additional fields for article images, videos, podcasts & other audio files, image galleries and attachments), hassle-free image management (uploaded item images are auto-resized to 6 configurable dimensions, either globally or per category - you can now forget about using Photoshop resizing!), comments, tagging, built-in options to extend content forms (e.g. to create product catalogs), powerful content modules fetching K2 content in any way you can imagine, frontend editing with easy to use access control settings (for content-heavy websites), powerful yet easy templating (and sub-templating) for going above the \"Joomla! average\", extended user profiles, user groups, blogs, a powerful plugin API to extend item/category/user forms, \"drag and drop\" media manager and many more!\r\n<br />\r\nK2 is the ideal solution for managing your content, regardless of site \"size\": you can use it from a small blog to a complex corporate site or even a multi-author environment (portals, magazines etc.). To provide a practical example, using K2, you can transform your Joomla! website to a news/magazine site with author blogs, product catalogs, work portfolio, knowledge base, download/document manager, directory listing, event listing and more, all this bundled under one package! And since K2 is extensible with additional fields to its base item form, you can easily create category-specific content types, e.g. article, blog post, product page, directory listing. </p>\r\n<br /><br />\r\n\r\n\r\n<h2>AcyMailing : Starter Edition <a href=\"http://www.acyba.com\">(www.acyba.com)</a></h2>\r\n<p>AcyMailing is a Joomla Extension released in 4 different editions : AcyMailing Starter, AcyMailing Essential, AcyMailing Business and AcyMailing Enterprise.\r\n\r\nAcyMailing enables you to create mailing lists, manage your subscribers, send Newsletters created with a templating system, create follow-up autoresponder campaigns, handle  bounce messages, track clicks, show statistics... </p>\r\n<br /><br />\r\n<h2>Stackideas Komento : Free Version <a href=\"http://stackideas.com/komento.html\">(www.stackideas.com)</a></h2>\r\n<p>Komento is a lightweight Joomla comment extension from our friends at stackideas.com. Komento is the perfect component to manage user comments in articles, blogs, and more. Discover the many thoughtful features of this great Joomla comment system giving users more than just expressing themselves. </p>\r\n\r\n', '', 1, 2, '2019-07-26 06:13:26', 60, '', '2019-07-26 06:13:26', 60, 0, '0000-00-00 00:00:00', '2019-07-26 06:13:26', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 35, 13, '', '', 1, 151, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', ''),
(52, 98, 'Template Framework', 'template-framework', '<div style=\"float: left; width: 456px; margin-right: 28px;\"><img src=\"images/templateparams.gif\" border=\"0\" width=\"400\" alt=\"tiadminpanel\" title=\"tiadminpanel\" class=\"imgframe\" /></div>\r\n<div style=\"float: left; width: 40%;  padding-left: 12px; margin-bottom: 12px;\">\r\n<h1 style=\"margin-bottom:20px; \">Joomla XTC Framework</h1>\r\n\r\n\r\nJoomlaXTC XTC Framework template system provides complete control over the template styles, from Width Adjustments, Region and Column Layout, Backgrounds, Font Colors / Sizes / Typeset, Module Layout, Menus and much more. 	<br /><br /> Using the standard Joomla! programming interface, the XTC Framework provides simple yet powerful template creation tools that allows developers to rapidly build or change every aspect of template elements and its administration panel and provide final users with easy and familiar controls to configure the template.  	<br /><br /> The following are some of the available features, more are coming! 	<br /><br /><br />\r\n\r\n<h2 style=\"font-size:32px;\">Layouts:</h2> <br /><br /> Layouts define the overall location of elements in the template, they can have their own set of style, typography or any other CSS Parameter Groups. Also they can have their own custom parameters for added functionality such as custom code, Javascript calls, etc.  	\r\n\r\n<br /><br />\r\n\r\n<ul class=\"list1\">\r\n<li>Support for one or multiple layouts each one with its own set of parameters. Switch your entire site look in two clicks!</li>\r\n<li>Layouts can share the same module position names or have custom ones for increased flexibility.</li>\r\n<li>CSS3 Responsive Bootstrapped Grid.</li>\r\n<li>Support mobile devices.</li>\r\n<li>Creating a new layout is as easy as copying the current one into another folder!</li>\r\n<li>PHP-based layout code allows any kind of customization or logic to be used</li>\r\n<li>Intelligent Grid rendering with standard Joomla! jdoc calls is available for easy placement of content areas</li>\r\n<li>The grid engine creates automatic CSS classes for easy styling: Need to edit the header of the bottom module in the first column of region3? CSS is as easy as: #region3 .firstcolumn .lastarea h3 {}</li>\r\n<li>Use region-based layouts with selectable region display order</li>\r\n<li>Easily switch column display order within a region</li>\r\n<li>From simple to advanced template layouts, the choice is yours!</li>\r\n</ul>\r\n<br />\r\n\r\n<h2 style=\"font-size:32px;\">Style Management:</h2> <br /><br /> XTC delivers powerful CSS features to ease the styling of templates. For example, you can combine multiple CSS preset styles to obtain the right look for your site. XTC template CSS can be split in as many groups as needed, each one capable of sharing one or more template parameters to control what you want, and if you need more groups, creating new ones is really simple.\r\n<br /><br /> 	\r\n<ul class=\"list1\">\r\n<li>Use Parameters Groups to organize CSS in many ways: Colors and Graphics, Module suffixes, Typography, Menu styling, etc.</li>\r\n<li>Use one CSS file with one or multiple Parameter Groups, or multiple CSS files for each group.</li>\r\n<li>CSS files can be edited from template backend, or use the template.css file to override any other CSS.</li>\r\n<li>Use PHP code inside CSS files with full access to all parameters for custom styles.</li>\r\n<li>Does not require multiple calls for CSS files to server</li>\r\n<li> Making an extra sets of parameters is as easy as copying one file!</li>\r\n</ul>\r\n<br />\r\n\r\n<h2 style=\"font-size:32px;\">Easy Menus:</h2> <br /><br /> Three menu modes included by default: Suckerfish, Two-column suckerfish and Drop line, each one selectable as a class in any mainmenu module! \r\n<br /><br />	\r\n<ul class=\"list1\">\r\n<li>Support list rendering</li>\r\n<li>Automatic CSS classes added for easy styling</li>\r\n<li>MooTools based for total compatibility</li>\r\n</ul>\r\n<br />\r\n\r\n<h2 style=\"font-size:32px;\">Framework Features:</h2><br /> <br />\r\n<ul class=\"list1\">\r\n<li>Fast, Joomla! API standard</li>\r\n<li>Select which components to show or hide in the frontpage</li>\r\n<li>Include all the CSS as part of the HTML document, as separate files or as a single file with the flip of a switch.</li>\r\n<li>Selectable CSS gzip compression for increased throughput</li>\r\n<li>Mark any parameter as \"public\" to allow their values be set from URL calls</li>\r\n<li>Public parameter values are independent by user/visitor</li>\r\n<li>Customizable CSS for the administation panel</li>\r\n</ul>\r\n\r\n<div style=\"clear:both;\"></div>\r\n</div>', '', 1, 2, '2019-07-26 06:13:26', 60, '', '2019-07-26 06:13:26', 60, 0, '0000-00-00 00:00:00', '2019-07-26 06:13:26', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 7, 12, '', '', 1, 116, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '');
