r />\r\n<div class=\"code\">&lt;div class=\"blog-grey\"&gt;blog-grey&lt;/div&gt;</div>\r\n<br />\r\n<div class=\"blog-pink\">This is Blog Pink</div>\r\n<br />\r\n<div class=\"code\">&lt;div class=\"blog-pink\"&gt;blog-pink&lt;/div&gt;</div>\r\n</div>\r\n</div>\r\n\r\n</div>\r\n\r\n\r\n\r\n\r\n<div class=\"typowrap\">\r\n\r\n<h1 class=\"pagetitle1\"><i class=\"icon-circle-arrow-right\"></i>Note Style</h1>\r\n\r\n<div class=\"note\">This the note style. Curabitur bibendum metus porta dui sagittis sagittis. Suspendisse placerat orci eget massa. Donec vitae nisi. Sed tincidunt adipiscing mauris. In lorem. Maecenas dapibus commodo sapien. Nam nulla.</div>\r\n\r\n<div class=\"code\">&lt;div class=\"note\"&gt;This is note style&lt;/div&gt;</div>\r\n\r\n</div>\r\n\r\n\r\n\r\n<div class=\"typowrap\">\r\n\r\n<h1 class=\"pagetitle1\"><i class=\"icon-circle-arrow-right\"></i>CSS3 Button Styles</h1>\r\n\r\n<div class=\"row-fluid\">\r\n\r\n    <div class=\"span6\">\r\n\r\n\r\n<div style=\"height:70px; margin-bottom:20px;\">\r\n<a class=\"GreyButton\">Grey Button</a> <br /><br />\r\n<div class=\"code\">&lt;a class=\"greybutton\"&gt;Grey Button&lt;/a&gt;</div>\r\n</div>\r\n\r\n<br /> <br />\r\n\r\n<div style=\"height:70px; margin-bottom:20px;\">\r\n<a class=\"BlueButton\">Blue Button</a> <br /><br />\r\n<div class=\"code\">&lt;a class=\"bluebutton\"&gt;Blue Button&lt;/a&gt;</div>\r\n</div>\r\n\r\n<br /><br />\r\n\r\n<div style=\"height:70px; margin-bottom:20px;\">\r\n<a class=\"OrangeButton\">Orange Button</a> <br /><br />\r\n<div class=\"code\">&lt;a class=\"orangebutton\"&gt;Orange Button&lt;/a&gt;</div>\r\n</div>\r\n\r\n<br /><br />\r\n\r\n<div style=\"height:70px; margin-bottom:20px;\">\r\n<a class=\"RedButton\">Red Button</a><br /><br />\r\n<div class=\"code\">&lt;a class=\"redbutton\"&gt;Red Button&lt;/a&gt;</div>\r\n</div>\r\n\r\n<br /><br />\r\n\r\n<div style=\"height:70px; margin-bottom:20px;\">\r\n<a class=\"PinkButton\">Pink Button</a><br /><br />\r\n<div class=\"code\">