(182, 256, 'Article Sidebars', 'article-sidebars', '<div class=\"comwrap\"><h1 style=\"font-size: 38px; letter spacing: -1px; border-bottom: 1px solid #cccccc; padding-bottom: 24px; margin: 12px 0 32px;\">Article Sidebars</h1>\r\n\r\n<p>The JoomlaXTC Framework includes Side Bar positions for Joomla Articles.  This solves one of the most frustrating  parts of Joomla; The ability to display a left or right module position only on Joomla Article pages and not on the Category page.  The only method up till now has been linking each article to a menu item and setting the modules to display on that menu link.</p>\r\n<h2>How Sidebars Work</h2>\r\n<p>The JoomlaXTC sidebars work by adding your modules to the \'sidebarleft\' or \'sidebarright\' module positions and selecting the module to show on all pages.  For more control you can select on all pages except and exclude some articles.</p></div>\r\n\r\n\r\n', '', 1, 2, '2019-07-26 06:13:26', 60, '', '2019-07-26 06:13:26', 60, 0, '0000-00-00 00:00:00', '2019-07-26 06:13:26', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"show_title\":\"0\",\"link_titles\":\"0\",\"show_intro\":\"1\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"0\",\"link_parent_category\":\"0\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"0\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_ar